import styled from 'styled-components'

const Page = styled.div`
  min-height: calc(100vh - 221px);
  margin-left: auto;
  margin-right: auto;
  max-width: 590px;
  padding-top: 50px;
  justify-content: center;
  flex-wrap: wrap;
`

export default Page
